import {Text,View } from 'react-native';
import { homePageStyles } from '../../styles/screenStyles/homeStyle';
import React from 'react';

const OnDeleveryText = ({arrive}) =>{
    return (
        <View>
            <Text style={deliveryCompStyles.text}>Beérkező készülékek száma {arrive} db</Text>
            <Text style={deliveryCompStyles.info}>Bővebb információ a "Beérkező" menüpontban található</Text>
        </View>
    )
}
export default OnDeleveryText;
